I had some fun days shooting with the Xiaomi Mi Note 10 and tested out some of the greatest new features. Hope you enjoy this video about my adventures. Stay tuned for the artworks I will create using the photos I took!

Die letzten Tage habe ich mit dem Xiaomi Mi Note 10 fotografiert und habe einige der neuen Features getestet. Ich hoffe Dir gefällt das Video über meine Abenteuer. Sei gespannt auf die Artworks! 
